import { BrowserRouter as Router, Routes, Route,   useRoutes } from 'react-router-dom';
import { useEffect } from "react";

import './App.css';
import Home from './Home';

function App() {
  useEffect(() => {
    WebFont.load({
      google: {
        families: ['Droid Sans', 'Chilanka']
      }
    })
  })
  return (
 
 <Router>
 <Routes>
  <Route path='/' element={<Home/>}/>


 </Routes>

</Router>

  );
}

export default App;
